import React from 'react';
import './App.css';
import Nav from './nav.js';
import { Provider } from 'react-redux';
import UserSectionComponent from './UserSectionComponent';
import store from './store';

function App() {
  return (
      <div className="App">
        <div><Nav/></div>
        <Provider store={store}>
         <UserSectionComponent />
        </Provider>
      </div>
  );
}

export default App;
